import { findByLabelText } from "@testing-library/react";
import { NavLink } from "react-router-dom";

const Stylednavbar = () => {
  return (
    <nav className="flex gap-4 font-mono bg-[#696667FF] text-[#964F4CFF] h-11 text-2xl px-5 py-1 ">
      <NavLink
        to="/"
        className={({ isActive }) =>
          isActive ? "underline text-emerald-600" : "text-[#a7120d]"
        }
      >
        Home
      </NavLink>
      <NavLink
        to="about"
        className={({ isActive }) =>
          isActive ? "underline text-emerald-600" : "text-[#964F4CFF]"
        }
      >
        About Me
      </NavLink>
      <NavLink
        to="projects"
        className={({ isActive }) =>
          isActive ? "underline text-emerald-600" : "text-[#964F4CFF]"
        }
      >
        Projects
      </NavLink>
      <NavLink
        to="contact"
        className={({ isActive }) =>
          isActive ? "underline text-emerald-600" : "text-[#964F4CFF]"
        }
      >
        Contact
      </NavLink>
    </nav>
  );
};

export default Stylednavbar;
